import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';


const Footer = () => {
    return(
        <div>              
            <footer className="bg-dark text-center fixed-bottom">              
                <a href="https://www.facebook.com/RS-Frangos-e-Pescados-107689614434652" rel="noopener noreferrer" target="_blank"><img src="/facebook.png" alt="Facebook" className="facebook"/></a>
                <a href="https://www.instagram.com/ranys1987/" rel="noopener noreferrer" target="_blank"><img src="/instagram.png" alt="Instagram" className="instagram"/></a>                            
            </footer>           
        </div>

    )
}

export default Footer;
